import { Fragment } from 'react';
import './ProfilePage.css';
import { Navbar } from '../../Components';

export const ProfilePage = () => {
    return (<Fragment>
        <Navbar/>
        <div className="profile-page">
                <div className="secondary-navbar">
                    <ul className="secondary-navbar-list">
                        <li className="secondary-navbar-item">Personal Details</li>
                        <li className="secondary-navbar-item">Courses Offered</li>
                        <li className="secondary-navbar-item">About Yourself</li>
                    </ul>
                </div>
                <div className="profile-content">
                    {/* Add the content for each section here */}
                </div>
            </div>
    </Fragment>)
}
